extra.description:
Creates a Schema with basic info

curl -X POST \
  'https://www.wixapis.com/translation-schema/v1/schemas' \
  -H 'Authorization: <AUTH>' \
  -H 'Content-Type: application/json' \
  --data-binary '{
    "schema": {
      "key": {
        "app_id": "4ad2dfe1-a943-45a8-94ac-f1dd8b78821b",
        "entity_type": "MyEntity",
        "scope": "GLOBAL"
        },
        "fields": {
            "entity.title": {
                "id": "entity.title",
                "type": "SHORT_TEXT",
                "display_name": "Title",
                "min_length": 1,
                "max_length": 54,
                "hidden": false,
                "display_only": false
            },
           "entity.description": {
                "id": "entity.description",
                "type": "LONG_TEXT",
                "display_name": "Description",
                "min_length": 1,
                "max_length": 256,
                "hidden": false,
                "display_only": false
           },
        }
      }
  }'

Queries a Schema by id, key, previewField, hidden, parent_id

curl -X POST \
  'https://www.wixapis.com/translation-schema/v1/schemas/query' \
  -H 'Authorization: <AUTH>' \
  -H 'Content-Type: application/json' \
  --data-binary '{
    "query": {
        "filter": {
            "key.app_id: "4ad2dfe1-a943-45a8-94ac-f1dd8b78821b"
        },
    }
  }'

